import React, {Fragment} from 'react'
import {Link} from 'react-router-dom'

const Header =(props)=>{
    return(
        <Fragment>
        {}
            <Link to="/search"> SEARCH </Link>
            <Link exact to="/"> HOME </Link>
        </Fragment>

    )
}
export default Header
